	]
};
export const metadata = {
  "id": "rancher2/installation/options/F5-7-layer-loadbalancer/_index",
  "title": "配置 F5 作为 Rancher 前端 7 层 LB",
  "description": "本文档基于 `BIGIP-15.0.1-0.0.11.ALL-vmware` 虚拟机版本编写，架构如下图所示。本文讲述了如何配置 F5 作为 Rancher 前端 7 层 LB。",
  "source": "@site/docs/rancher2/installation/options/F5-7-layer-loadbalancer/_index.md",
  "permalink": "/docs/rancher2/installation/options/F5-7-layer-loadbalancer/_index",
  "editUrl": "https://github.com/cnrancher/docs-rancher2/edit/master/docs/rancher2/installation/options/F5-7-layer-loadbalancer/_index.md",
