export const rightToc = [{
  value: '架构说明',
  id: '架构说明',
  children: []
}, {
  value: '代理配置',
  id: '代理配置',
  children: [{
    value: '步骤 1：配置健康检查',
    id: '步骤-1：配置健康检查',
    children: []
  }, {
    value: '步骤 2：添加节点（可选）',
    id: '步骤-2：添加节点（可选）',
    children: []
  }, {
    value: '步骤 3：添加节点池',
    id: '步骤-3：添加节点池',
    children: []
  }, {
    value: '步骤 4：添加 irule',
    id: '步骤-4：添加-irule',
    children: []
  }, {
    value: '步骤 5：添加证书',
    id: '步骤-5：添加证书',
    children: []
  }]
}, {
  value: '添加 SSL Profile',
  id: '添加-ssl-profile',
  children: []
}, {
  value: '配置 Rancher Virtual Servers',
  id: '配置-rancher-virtual-servers',
  children: []
}, {
