const makeShortcode = name => function MDXDefaultShortcode(props) {
  console.warn("Component " + name + " was not imported, exported, or provided by MDXProvider as global scope")
  return <div {...props}/>
};

const layoutProps = {
  rightToc
};
const MDXLayout = "wrapper"
export default function MDXContent({
  components,
  ...props
}) {
  return <MDXLayout {...layoutProps} {...props} components={components} mdxType="MDXLayout">

    <h2 {...{
      "id": "架构说明"
    }}>{`架构说明`}</h2>
    <p>{`本文档基于 `}<inlineCode parentName="p">{`BIGIP-15.0.1-0.0.11.ALL-vmware`}</inlineCode>{` 虚拟机版本编写，架构如下图所示。`}</p>
    <p><img parentName="p" {...{
        "src": "/img/rancher/F5-7-layer-loadbalancer/architecture.png",
        "alt": "架构图"
      }}></img></p>
    <h2 {...{
      "id": "代理配置"
    }}>{`代理配置`}</h2>
    <h3 {...{
      "id": "步骤-1：配置健康检查"
    }}>{`步骤 1：配置健康检查`}</h3>
    <p>{`单击 `}<inlineCode parentName="p">{`Local Traffic`}</inlineCode>{`，然后单击 `}<inlineCode parentName="p">{`Monitors`}</inlineCode>{` 右侧的 `}<inlineCode parentName="p">{`➕`}</inlineCode>{`图标，添加监控。需要修改或新增的参数如下：`}</p>
    <ul>
      <li parentName="ul">{`“Name”一栏输名称，下图例子输入的是 http-rancher，对应的是 rancher 的 http 健康检查。`}</li>
      <li parentName="ul">{`“Description”一栏输入关于这个健康检查的描述，可跳过，非必填项。`}</li>
      <li parentName="ul">{`“Type” 选择类型为 `}<inlineCode parentName="li">{`http`}</inlineCode></li>
      <li parentName="ul">{`“Send String”填写参数为：`}<inlineCode parentName="li">{`GET /healthz \\r\\n`}</inlineCode>{`。`}</li>
    </ul>
    <p>{`其他参数保持默认即可。单击“Finished”，完成健康检查配置。`}</p>
    <p><img parentName="p" {...{
        "src": "/img/rancher/F5-7-layer-loadbalancer/health-check-config.jpg",
        "alt": "配置健康检查"
      }}></img></p>
    <h3 {...{
      "id": "步骤-2：添加节点（可选）"
    }}>{`步骤 2：添加节点（可选）`}</h3>
    <ol>
      <li parentName="ol">
        <p parentName="li">{`单击 `}<inlineCode parentName="p">{`Local Traffic`}</inlineCode>{`，然后单击 `}<inlineCode parentName="p">{`Nodes > Nodes List`}</inlineCode>{` 旁边的 `}<inlineCode parentName="p">{`➕`}</inlineCode>{`，添加节点。`}</p>
        <p parentName="li"><img parentName="p" {...{
            "src": "/img/rancher/F5-7-layer-loadbalancer/add-node-1.jpg",
            "alt": "添加节点1"
          }}></img></p>
      </li>
      <li parentName="ol">
        <p parentName="li">{`按照下图示例配置节点信息。请将`}<inlineCode parentName="p">{`Health Monitors`}</inlineCode>{` 设置为 `}<inlineCode parentName="p">{`None`}</inlineCode>{`。`}</p>
        <p parentName="li"><img parentName="p" {...{
            "src": "/img/rancher/F5-7-layer-loadbalancer/add-node-2.jpg",
            "alt": "添加节点2"
          }}></img></p>
      </li>
    </ol>
    <h3 {...{
      "id": "步骤-3：添加节点池"
    }}>{`步骤 3：添加节点池`}</h3>
    <ol>
      <li parentName="ol">
        <p parentName="li">{`单击 `}<inlineCode parentName="p">{`Local Traffic > Pools > Pool List`}</inlineCode>{` 旁边的 `}<inlineCode parentName="p">{`➕`}</inlineCode>{`添加节点池。`}</p>
        <p parentName="li"><img parentName="p" {...{
            "src": "/img/rancher/F5-7-layer-loadbalancer/add-pool-1.jpg",
            "alt": "添加节点池1"
          }}></img></p>
      </li>
      <li parentName="ol">
        <p parentName="li">{`按照下图示例配置节点池。`}</p>
      </li>
    </ol>
    <ul>
      <li parentName="ul">
        <p parentName="li">{`设置节点池名称。`}</p>
      </li>
      <li parentName="ul">
        <p parentName="li"><inlineCode parentName="p">{`Health Monitors`}</inlineCode>{` 选择先前创建的健康检查。`}</p>
      </li>
      <li parentName="ul">
        <p parentName="li"><inlineCode parentName="p">{`New Members`}</inlineCode>{` 中选择 `}<inlineCode parentName="p">{`Node List`}</inlineCode>{`，选择开始添加的节点，单击下方的 `}<inlineCode parentName="p">{`Add`}</inlineCode>{`，端口以实际 Rancher 暴露的端口为准。`}</p>
        <p parentName="li"><img parentName="p" {...{
            "src": "/img/rancher/F5-7-layer-loadbalancer/add-pool-2.jpg",
            "alt": "添加节点池2"
          }}></img></p>
      </li>
    </ul>
    <h3 {...{
      "id": "步骤-4：添加-irule"
    }}>{`步骤 4：添加 irule`}</h3>
    <ol>
      <li parentName="ol">
        <p parentName="li">{`单击 `}<inlineCode parentName="p">{`Local Traffic > iRules > iRules List`}</inlineCode>{` 旁边的 `}<inlineCode parentName="p">{`➕`}</inlineCode>{`，添加 irule。`}</p>
        <p parentName="li"><img parentName="p" {...{
            "src": "/img/rancher/F5-7-layer-loadbalancer/irule-1.jpg",
            "alt": "添加irule1"
          }}></img></p>
      </li>
      <li parentName="ol">
        <p parentName="li">{`设置 irule 名称，将以下内容复制粘到文本框内。`}</p>
        <pre parentName="li"><code parentName="pre" {...{
            "className": "language-json"
          }}>{`when HTTP_REQUEST {
  HTTP::header insert “X-Forwarded-Proto” “https”;
  HTTP::header insert “X-Forwarded-Port” 443;
  HTTP::header insert “X-Forwarded-For” [IP::client_addr];
}
`}</code></pre>
        <p parentName="li"><img parentName="p" {...{
            "src": "/img/rancher/F5-7-layer-loadbalancer/irule-2.jpg",
            "alt": "添加irule2"
          }}></img></p>
      </li>
    </ol>
    <h3 {...{
      "id": "步骤-5：添加证书"
    }}>{`步骤 5：添加证书`}</h3>
    <ol>
      <li parentName="ol">
        <p parentName="li">{`访问 `}<inlineCode parentName="p">{`system > Certificate Management > Traffic Certificate Management > SSL Certificate List > Import`}</inlineCode>{`。`}</p>
        <p parentName="li"><img parentName="p" {...{
            "src": "/img/rancher/F5-7-layer-loadbalancer/cert-1.jpg",
            "alt": "添加证书1"
          }}></img></p>
      </li>
      <li parentName="ol">
        <p parentName="li">{`选择导入类型为 `}<inlineCode parentName="p">{`key`}</inlineCode>{` 和 `}<inlineCode parentName="p">{`certificate`}</inlineCode>{`，然后选择导入文件。注意：权威证书会有中间链 CA 证书，所以这里会多一个 CA 证书，如果是自签名证书则可以忽略这个 CA 证书。`}</p>
        <p parentName="li"><img parentName="p" {...{
            "src": "/img/rancher/F5-7-layer-loadbalancer/cert-2.jpg",
            "alt": "添加证书2"
          }}></img></p>
        <p parentName="li"><img parentName="p" {...{
            "src": "/img/rancher/F5-7-layer-loadbalancer/cert-3.jpg",
            "alt": "添加证书3"
          }}></img></p>
        <p parentName="li"><img parentName="p" {...{
            "src": "/img/rancher/F5-7-layer-loadbalancer/cert-4.jpg",
            "alt": "添加证书4"
          }}></img></p>
      </li>
    </ol>
    <h2 {...{
      "id": "添加-ssl-profile"
    }}>{`添加 SSL Profile`}</h2>
    <ol>
      <li parentName="ol">
        <p parentName="li">{`单击 `}<inlineCode parentName="p">{`Local Traffic > Profiles > SSL > client`}</inlineCode>{` 旁边的 `}<inlineCode parentName="p">{`➕`}</inlineCode>{`，添加 SSL Profile。`}</p>
        <p parentName="li"><img parentName="p" {...{
            "src": "https://markdown-1300017440.cos.ap-shanghai.myqcloud.com/mweb/15933288411909.jpg",
            "alt": null
          }}></img>{`
`}<img parentName="p" {...{
            "src": "/img/rancher/F5-7-layer-loadbalancer/SSL-1.jpg",
            "alt": "添加 SSL Profile1"
          }}></img></p>
      </li>
      <li parentName="ol">
        <p parentName="li">{`配置 SSL 相关参数`}</p>
        <ul parentName="li">
          <li parentName="ul">{`输入 profile 名称。`}</li>
          <li parentName="ul"><inlineCode parentName="li">{`Configuration`}</inlineCode>{` 选择高级配置，并单击右侧自定义。`}</li>
          <li parentName="ul"><inlineCode parentName="li">{`Certificate Key Chain`}</inlineCode>{` 处单击 `}<inlineCode parentName="li">{`Add`}</inlineCode>{`，然后选择对应的证书和私钥。`}</li>
        </ul>
        <p parentName="li"><img parentName="p" {...{
            "src": "https://markdown-1300017440.cos.ap-shanghai.myqcloud.com/mweb/15933288900033.jpg",
            "alt": null
          }}></img>{`
`}<img parentName="p" {...{
            "src": "/img/rancher/F5-7-layer-loadbalancer/SSL-2.jpg",
            "alt": "添加 SSL Profile2"
          }}></img></p>
      </li>
      <li parentName="ol">
        <p parentName="li">{`添加之后`}</p>
        <p parentName="li"><img parentName="p" {...{
            "src": "https://markdown-1300017440.cos.ap-shanghai.myqcloud.com/mweb/15933288984319.jpg",
            "alt": null
          }}></img>{`
`}<img parentName="p" {...{
            "src": "/img/rancher/F5-7-layer-loadbalancer/SSL-3.jpg",
            "alt": "添加 SSL Profile3"
          }}></img></p>
      </li>
      <li parentName="ol">
        <p parentName="li">{`其他参数保持默认即可。`}</p>
      </li>
    </ol>
    <h2 {...{
      "id": "配置-rancher-virtual-servers"
    }}>{`配置 Rancher Virtual Servers`}</h2>
    <ol>
      <li parentName="ol">
        <p parentName="li">{`单击 `}<inlineCode parentName="p">{`Local Traffic > Virtual Servers > Virtual Server List`}</inlineCode>{` 旁边的 `}<inlineCode parentName="p">{`➕`}</inlineCode>{`。`}</p>
      </li>
      <li parentName="ol">
        <p parentName="li">{`配置 `}<inlineCode parentName="p">{`Name`}</inlineCode>{`，输入 Server 名称。`}</p>
      </li>
      <li parentName="ol">
        <p parentName="li">{`保持 `}<inlineCode parentName="p">{`Type`}</inlineCode>{` 为默认。`}</p>
      </li>
      <li parentName="ol">
        <p parentName="li">{`配置 `}<inlineCode parentName="p">{`Source Address`}</inlineCode>{` 为 `}<inlineCode parentName="p">{`0.0.0.0/0`}</inlineCode>{`。`}</p>
      </li>
      <li parentName="ol">
        <p parentName="li">{`根据实际情况配置 `}<inlineCode parentName="p">{`Destination Address/Mask`}</inlineCode>{`。`}</p>
      </li>
      <li parentName="ol">
        <p parentName="li"><inlineCode parentName="p">{`Service Port`}</inlineCode>{` 设置为 `}<inlineCode parentName="p">{`443/https`}</inlineCode>{`。`}</p>
      </li>
      <li parentName="ol">
        <p parentName="li"><inlineCode parentName="p">{`Configuration`}</inlineCode>{` 选择高级。`}</p>
      </li>
      <li parentName="ol">
        <p parentName="li"><inlineCode parentName="p">{`HTTP Profile (Client)`}</inlineCode>{` 设置为 `}<inlineCode parentName="p">{`http`}</inlineCode>{`。`}</p>
      </li>
      <li parentName="ol">
        <p parentName="li"><inlineCode parentName="p">{`SSL Profile (Client)`}</inlineCode>{` 选择之前创建的 `}<inlineCode parentName="p">{`SSL Profile`}</inlineCode>{`。`}</p>
      </li>
      <li parentName="ol">
        <p parentName="li"><inlineCode parentName="p">{`WebSocket Profile`}</inlineCode>{` 选择 `}<inlineCode parentName="p">{`WebSocket`}</inlineCode>{`。`}</p>
      </li>
      <li parentName="ol">
        <p parentName="li"><inlineCode parentName="p">{`Source Address Translation`}</inlineCode>{` 选择 `}<inlineCode parentName="p">{`auto map`}</inlineCode>{`。`}</p>
      </li>
      <li parentName="ol">
        <p parentName="li">{`在 `}<inlineCode parentName="p">{`Resources\\iRules`}</inlineCode>{` 中选择之前创建 `}<inlineCode parentName="p">{`iRules`}</inlineCode>{` 规则。`}</p>
      </li>
      <li parentName="ol">
        <p parentName="li"><inlineCode parentName="p">{`Default Pool`}</inlineCode>{` 选择之前创建的主机池。`}</p>
      </li>
    </ol>
    <p>{`完成配置如下图所示：`}</p>
    <p><img parentName="p" {...{
        "src": "/img/rancher/F5-7-layer-loadbalancer/Virtual-Server-1.jpg",
        "alt": "配置 Rancher Virtual Servers1"
      }}></img></p>
    <p><img parentName="p" {...{
        "src": "/img/rancher/F5-7-layer-loadbalancer/Virtual-Server-2.jpg",
        "alt": "配置 Rancher Virtual Servers2"
      }}></img></p>
    <p><img parentName="p" {...{
        "src": "/img/rancher/F5-7-layer-loadbalancer/Virtual-Server-3.jpg",
        "alt": "配置 Rancher Virtual Servers3"
      }}></img></p>
    <p><img parentName="p" {...{
        "src": "/img/rancher/F5-7-layer-loadbalancer/Virtual-Server-4.jpg",
        "alt": "配置 Rancher Virtual Servers4"
      }}></img></p>
    <p><img parentName="p" {...{
        "src": "/img/rancher/F5-7-layer-loadbalancer/Virtual-Server-5.jpg",
        "alt": "配置 Rancher Virtual Servers5"
      }}></img></p>
    <h2 {...{
      "id": "http-重定向到-https"
    }}>{`HTTP 重定向到 HTTPS`}</h2>
    <p>{`单击 `}<inlineCode parentName="p">{`Local Traffic > Virtual Servers > Virtual Server List`}</inlineCode>{` 旁边的 `}<inlineCode parentName="p">{`➕`}</inlineCode>{`，按照以下描述配置参数：`}</p>
    <ol>
      <li parentName="ol">{`配置 `}<inlineCode parentName="li">{`Name`}</inlineCode>{`。`}</li>
      <li parentName="ol">{`保持 `}<inlineCode parentName="li">{`Type`}</inlineCode>{` 为默认。`}</li>
      <li parentName="ol">{`配置 `}<inlineCode parentName="li">{`Source Address`}</inlineCode>{` 为 `}<inlineCode parentName="li">{`0.0.0.0/0`}</inlineCode>{`。`}</li>
      <li parentName="ol">{`根据实际情况配置 `}<inlineCode parentName="li">{`Destination Address/Mask`}</inlineCode>{`。`}</li>
      <li parentName="ol"><inlineCode parentName="li">{`Service Port`}</inlineCode>{` 设置为 `}<inlineCode parentName="li">{`80/http`}</inlineCode>{`。`}</li>
      <li parentName="ol"><inlineCode parentName="li">{`Configuration`}</inlineCode>{` 选择基础。`}</li>
      <li parentName="ol"><inlineCode parentName="li">{`HTTP Profile (Client)`}</inlineCode>{` 设置为 `}<inlineCode parentName="li">{`http`}</inlineCode>{`。`}</li>
      <li parentName="ol">{`在`}<inlineCode parentName="li">{`Resources\\iRules`}</inlineCode>{` 中选择 `}<inlineCode parentName="li">{`_sys_https_redirect`}</inlineCode>{`。`}</li>
    </ol>
    </MDXLayout>;
}

;
MDXContent.isMDXComponent = true;
